import App from '../../App';
import './Form.scss';

function NavBar() {
    return (
        <>
            <section className="comment-section">
                <h3 className="comment-section__total-comments">3 Comments</h3>
                <div className="comment-section__form--image-container">
                    <img className="comment-section__form--icon" src="./assets/images/Mohan-muruge.jpg"></img>
                </div>
                    
            </section>
        </>
    )
}
